### Why a new engine
* Parallel
* Memory safety
* Performance
* Modularity
* Embedding
* GPU (WebRender)

---
### Implementation Strategy
* __Rewrite__ layout, rendering, HTML/CSS parsing, networking, core engine glue
* __Reuse__ JS engine, media codecs, graphics libs, fonts, WebRTC
* __Bootstrap__ with OpenSSL, image libs, etc.

### Build system & Test
* Mach (python)
* Unit tests
* Web platform tests (WPT)
* CSS WG Tests

### Debugging
* Time / Memory profiling
* gdb / lldb
* `RUST_LOG`, `RUST_BACKTRACE=1`

### Roadmap
* [June Tech Preview](https://groups.google.com/forum/#!topic/mozilla.dev.servo/dcrNW6389g4)
* Oxidation: move Rust/Servo component into Gecko
* [more](https://github.com/servo/servo/wiki/Roadmap)

### Why contributing
* It's fun
* It's challenging
* It's relative new so there are low-hanging fruits

---
### Good First Bug
* [Servo Starters](http://servo.github.io/servo-starters/)
* GitHub: https://github.com/servo/servo
---
### Getting Started
* `git clone https://github.com/servo/servo.git` 
* Create a branch, write code
* `./mach build --debug`
* `./mach test-*`
* Submit a PR
* Code review (Reviewable.io)
* Rebase => Auto-test => Merge

---
### Getting Help
* GitHub Issues
* IRC: `#servo` on `irc.mozilla.org`
* Mailing list: dev-servo@lists.mozilla.org

####Shing Lyu
* `shinglyu` on IRC (UTC+8)
* slyu@mozilla.com
